bool  moveplayer(IAPI& api, int ms, double eee, int ox, int oy, std::vector<std::shared_ptr<const THUAI5::Robot>> robots)
{
	if (eee < PI)
	{
		if (eee < PI / 2)
		{
			if (the_map[(ox + 510) / 1000][oy / 1000]) return api.MoveRight(200);
			else if (the_map[ox / 1000][(oy + 510) / 1000]) return api.MoveDown(200);
		}
		else
		{
			if (the_map[(ox - 510) / 1000][oy / 1000]) return api.MoveRight(200);
			else if (the_map[ox / 1000][(oy + 510) / 1000]) return api.MoveUp(200);
		}
	}
	else
	{
		if (eee > PI * 3 / 2)
		{
			if (the_map[(ox + 510) / 1000][oy / 1000]) return api.MoveLeft(200);
			else if (the_map[ox / 1000][(oy - 510) / 1000]) return api.MoveDown(200);
		}
		else
		{
			if (the_map[(ox - 510) / 1000][oy / 1000]) return api.MoveLeft(200);
			else if (the_map[ox / 1000][(oy - 510) / 1000]) return api.MoveUp(200);
		}
	}
	return api.MovePlayer(ms, eee);
}
