bool check4(int ox, int oy, int mx, int my)
{
	if (oy / 1000 == my / 1000)
	{
		for (int i = min(ox, mx) + 1; i < max(ox, mx); i += 1000)
		{
			if (born_map2[i / 1000][oy / 1000]) continue;
			if (the_map2[i / 1000][oy / 1000] == 1)return 0;
			if (oy > oy / 1000 * 1000 + 500 && the_map2[i / 1000][oy / 1000 + 1])return 0;
			else if (oy < oy / 1000 * 1000 + 500 && the_map2[i / 1000][oy / 1000 - 1])return 0;
		}
		return 1;
	}
	if (ox / 1000 == mx / 1000)
	{
		for (int i = min(oy, my) + 1; i < max(oy, my); i += 1000)
		{
			if (born_map2[ox / 1000][i / 1000]) continue;
			if (the_map2[ox / 1000][i / 1000] == 1)return 0;
			if (ox > ox / 1000 * 1000 + 500 && the_map2[ox / 1000 + 1][i / 1000])return 0;
			else if (ox < ox / 1000 * 1000 + 500 && the_map2[ox / 1000 - 1][i / 1000])return 0;
		}
		return 1;
	}
	int Xmin = ox < mx ? ox : mx;
	int Xmax = ox > mx ? ox : mx;
	int Ymin = oy < my ? oy : my;
	int Ymax = oy > my ? oy : my;
	if (Xmax - Xmin > Ymax - Ymin)
	{
		double k = (my - oy) * 1.0 / (mx - ox);
		double b = oy - k * ox;
		double kk = sqrt(1 + 1.0 / k / k);
		double dbz = 600 * k * kk;
		int ii;
		for (int i = Xmin / 1000 + 1; i <= Xmax / 1000; i += 1)
		{
			ii = i * 1000;
			if (the_map2[ii / 1000][(int)(k * ii + b) / 1000] == 1 && !born_map2[ii / 1000][(int)(k * ii + b) / 1000]) return 0;
			ii = ii - 600 / kk;
			if (the_map2[(ii) / 1000][(int)(k * ii + b + dbz) / 1000] == 1 && !born_map2[(ii) / 1000][(int)(k * ii + b + dbz) / 1000]) return 0;
			ii = ii + 1200 / kk;
			if (the_map2[(ii) / 1000][(int)(k * ii + b - dbz) / 1000] == 1 && !born_map2[(ii) / 1000][(int)(k * ii + b - dbz) / 1000]) return 0;
		}
	}
	else
	{
		double k = (mx - ox) * 1.0 / (my - oy);
		double b = ox - k * oy;
		double kk = sqrt(1 + 1.0 / k / k);
		double dbz = 600 * k * kk;
		int ii;
		for (int i = Ymin / 1000 + 1; i <= Ymax / 1000; i += 1)
		{
			ii = i * 1000;
			if (the_map2[(int)(k * ii + b) / 1000][ii / 1000] == 1 && !born_map2[(int)(k * ii + b) / 1000][ii / 1000]) return 0;
			ii = ii - 600 / kk;
			if (the_map2[(int)(k * ii + b + dbz) / 1000][(ii) / 1000] == 1 && !born_map2[(int)(k * ii + b + dbz) / 1000][(ii) / 1000]) return 0;
			ii = ii + 2 * 600 / kk;
			if (the_map2[(int)(k * ii + b - dbz) / 1000][(ii) / 1000] == 1 && !born_map2[(int)(k * ii + b - dbz) / 1000][(ii) / 1000]) return 0;
		}
	}
	return 1;
}

