double poor_angle(double angle1, double angle2)
{//计算两角之差
	double poor_angle_ = angle1 - angle2;
	if (abs(poor_angle_) <= PI - 0.0001) return poor_angle_;
	else
	{
		if (poor_angle_ > 0) return poor_angle_ - 2 * PI;
		else return poor_angle_ + 2 * PI;
	}
}
double protect_dangerous(int self_x, int self_y, int jammer_x, int jammer_y, int jammer_direction, int jammer_type)
{  //判断躲避危险方向的函数
	double relativeDirection, distance, angle;
	distance = dis(self_x, self_y, jammer_x, jammer_y);
	relativeDirection = getDirection(self_x, self_y, jammer_x, jammer_y);
	angle = abs(poor_angle(relativeDirection, jammer_direction));
	if (angle >= PI) angle = 2 * PI - angle;
	if (jammer_type == 0) return 10.0;
	if (jammer_type == 2) {//普通炮
		if (angle >= (PI / 2)) {
			if (distance > 4000) return 10.0;
			else return relativeDirection;
		}
		else {
			if (distance * sin(angle) > 7000.0 || distance * cos(angle) > 20000.0) return 10.0;
			else {
				return relativeDirection;
			}
		}
	}
	else if (jammer_type == 1) {//激光线性炮
		if (angle >= (PI / 2))  return 10.0;
		else {
			if (distance * sin(angle) > 1000.0 || distance * cos(angle) > 6000.0) return 10.0;
			else {
				return (relativeDirection + PI / 2);
			}
		}
	}
	else if (jammer_type == 3) {//快速弹
		if (angle >= (PI / 2)) {
			if (distance > 4000) return 10.0;
			else return relativeDirection;
		}
		else {
			if (distance * sin(angle) > 5000.0 || distance * cos(angle) > 15000.0) return 10.0;
			else {
				return (relativeDirection + PI / 2);
			}
		}
	}
	else if (jammer_type == 4) {// 强力弹
			if (angle >= (PI / 2)) {
				if (distance > 10000) return 10.0;
				else return relativeDirection;
			}
			else {
				if (distance * sin(angle) > 12000.0 || distance * cos(angle) > 30000.0) return 10.0;
				else {
					return relativeDirection;
				}
			}
	}
}


