				int oy = self->y;
				if (paodan.size() > 0)
				{
					for (int i = 0; i < paodan.size(); i++)
					{
						if (paodan[i]->parentTeamID != self->teamID)
						{
							pao.push_back(std::make_pair(paodan[i]->x, paodan[i]->y));
						}
					}
				}
